    false,nt"url": null,nt"notes": "This annual narrative report for Selawik
    National Wildlife Refuge outlines Refuge accomplishments during the 1994 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, the management plan, public participation, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, croplands,
    fire management, pest control, and wilderness areas. The wildlife section of the
    report discusses wildlife diversity, waterfowl, shorebirds, raptors, game mammals,
    marine mammals, fisheries resources, and marking and banding. The public uses of
    the Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, and communication systems.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
